//n16hth4wkk.github.io/bevy-gol-explore-part-5/":{"tf":1.0}},"df":5}}}},"p":{"docs":{},"df":0,"a":{"docs":{},"df":0,"r":{"docs":{},"df":0,"t":{"docs":{"https://n16hth4wkk.github.io/bevy-gol-explore-part-1/":{"tf":1.0},"https://n16hth4wkk.github.io/bevy-gol-explore-part-2/":{"tf":1.0},"https://n16hth4wkk.github.io/bevy-gol-explore-part-3/":{"tf":1.0},"https://n16hth4wkk.github.io/bevy-gol-explore-part-4/":{"tf":1.0},"https://n16hth4wkk.github.io/bevy-gol-explore-part-5/":{"tf":1.0}},"df":5}}},"o":{"docs":{},"df":0,"s":{"docs":{},"df":0,"t":{"docs":{"https://n16hth4wkk.github.io/first-post/":{"tf":1.0}},"df":1}}}},"s":{"docs":{},"df":0,"h":{"docs":{},"df":0,"a":{"docs":{},"df":0,"d":{"docs":{},"df":0,"e":{"docs":{},"df":0,"r":{"docs":{"https://n16hth4wkk.github.io/bevy-gol-explore-part-1/":{"tf":1.0},"https://n16hth4wkk.github.io/bevy-gol-explore-part-2/":{"tf":1.0},"https://n16hth4wkk.github.io/bevy-gol-explore-part-3/":{"tf":1.0},"https://n16hth4wkk.github.io/bevy-gol-explore-part-4/":{"tf":1.0},"https://n16hth4wkk.github.io/bevy-gol-explore-part-5/":{"tf":1.0}},"df":5}}}}}}}}},"documentStore":{"save":true,"docs":{"https://n16hth4wkk.github.io/":{"body":"","id":"https://n16hth4wkk.github.io/","title":""},"https://n16hth4wkk.github.io/about/":{"body":"My name is Jacob LeCoq. By day I am a full-stack engineer working at Bayer in their Crop Science Division, while at night, I am a Rust/game developer hobbyist.\n","id":"https://n16hth4wkk.github.io/about/","title":"About Me"},"https://n16hth4wkk.github.io/archive/":{"body":"","id":"https://n16hth4wkk.github.io/archive/","title":"Archive"},"https://n16hth4wkk.github.io/bevy-gol-explore-part-1/":{"body":"Recently, I have found myself facinated by graphical programming. On the side, I started following a tutorial by hakolao,\nwhich explores compute shaders with bevy using vulkano. If you are interested,\nthis is the tutorial compute_shader_tutorial.\nAs a fun exercise, I decided to explore using compute shaders using wgpu within bevy. This is part 1 of exploring bevy game of life shader example, and\nsome ways to enhance the experience.\n\nI assume you have general knowledge of rust, bevy, and wgpu, but I will still explain somethings along the way. If you need a refresher on anything, here\nare some helpful resources:\nLearn Rust\nBevy Book\nBevy Cheatbook\nLearn Wgpu\nSo lets get started!\nSetup\nThis tutorial currently follows along using Bevy 0.10.\nI am using the bevy_game_template as my starter, just with all the extra code ripped out, except for main and lib.\n// main.rs\n\n// &lt;imports&gt;\n...\n\nfn main() {\n    App::new()\n        .insert_resource(ClearColor(Color::BLACK))\n        .add_plugins(DefaultPlugins.set(WindowPlugin {\n            primary_window: Some(Window {\n                canvas: Some(\"#shader_playground\".to_owned()),\n                title: \"Shader Playground\".to_string(),\n                present_mode: bevy::window::PresentMode::AutoNoVsync, // unthrottled FPS\n                ..default()\n            }),\n            ..default()\n        }))\n        .add_plugin(ShaderPlaygroundPlugin)\n        .add_system(set_window_icon.on_startup())\n        .run();\n}\n\n// &lt;window_icon sys&gt;\n...\n\n\n// lib.rs\n\n// &lt;imports&gt;\n...\n\nconst SIM_SIZE: (u32, u32) = (1280, 720);\nconst WORKGROUP_SIZE: u32 = 8;\n\npub struct ShaderPlaygroundPlugin;\nimpl Plugin for ShaderPlaygroundPlugin {\n    fn build(&amp;self, app: &amp;mut App) {\n        app.add_plugin(FrameTimeDiagnosticsPlugin::default())\n            .add_system(window_fps);\n    }\n}\n\nfn window_fps(diagnostics: Res&lt;Diagnostics&gt;, mut windows: Query&lt;&amp;mut Window, With&lt;PrimaryWindow&gt;&gt;) {\n    if let Ok(mut window) = windows.get_single_mut() {\n        if let Some(fps_diagnostic) = diagnostics.get(FrameTimeDiagnosticsPlugin::FPS) {\n            if let Some(fps_smoothed) = fps_diagnostic.smoothed() {\n                window.title = format!(\"{fps_smoothed:.2}\");\n            }\n        }\n    }\n}\n\n\nPretty simple setup. Just added a simple fps system to print the FPS at the top of the window. We need to setup our canvas for our simulation.\nWe will just use a simple image constrained to our SIM_SIZE variable. You can organize your code how you feel, but I will be breaking out the code\nfrom the original example into seperate files for readability.\n// image.rs\n\n#[derive(Resource, Clone, Deref, ExtractResource)]\npub struct GameOfLifeImage(pub Handle&lt;Image&gt;);\n\npub fn create_image(width: u32, height: u32) -&gt; Image {\n    let mut image = Image::new_fill(\n        Extent3d {\n            width,\n            height,\n            depth_or_array_layers: 1,\n        },\n        TextureDimension::D2,\n        &amp;[0, 0, 0, 255],\n        TextureFormat::Rgba8Unorm,\n    );\n\n    image.texture_descriptor.usage =\n        TextureUsages::COPY_DST | TextureUsages::STORAGE_BINDING | TextureUsages::TEXTURE_BINDING;\n\n    image\n}\n\n\nThis is just a simple helper function to create an image. We will be using this to create our simulation image. GameOfLifeImage will hold a reference to our\nhandle image so that it doesn't get unloaded. You will see it is annotated with ExtractResource derive. This is required to extract the image from the main bevy\nworld into the render world. You can also manually derive this, if needed. Lets use it within our setup function. Back in\nlib.rs:\n...\nfn setup(mut commands: Commands, mut images: ResMut&lt;Assets&lt;Image&gt;&gt;) {\n    let image = image::create_image(SIM_SIZE.0, SIM_SIZE.1);\n    let image = images.add(image);\n\n    commands.spawn(SpriteBundle {\n        sprite: Sprite {\n            custom_size: Some(Vec2::new(SIM_SIZE.0 as f32, SIM_SIZE.1 as f32)),\n            ..default()\n        },\n        texture: image.clone(),\n        ..default()\n    });\n\n    commands.spawn(Camera2dBundle::default());\n    commands.insert_resource(image::GameOfLifeImage(image));\n}\n\nQuick and easy. Just create our image, create a sprite based off the image, spawn a 2D camera, and then inject our resource into bevy world.\nNow we just need to hookup our system back in the plugin.\nfn build(&amp;self, app: &amp;mut App) {\n    app.add_plugin(FrameTimeDiagnosticsPlugin::default())\n        .add_startup_system(setup)\n        .add_system(window_fps);\n}\n\nRunning the simulation should produce a black screen and nothing more. But hey! No errors! Lets move on.\nAs mentioned earlier, bevy has a render world which is extracted each render instance. We need to tell our render setup how to access members from the main world.\nIn our plugin, add the ExtractResourcePlugin for our GameOfLifeImage resource.\n...\n// Extract the game of life image resource from the main world into the render world\n// for operation on by the compute shader and display on the sprite.\napp.add_plugin(ExtractResourcePlugin::&lt;GameOfLifeImage&gt;::default());\n...\n\nNow onto the actual meat of why I am writing this. Lets get into wgpu. We will be using a compute shader, so our pipeline will need to be a ComputePipeline.\n\nA pipeline describes all the actions the gpu will perform when acting on a set of data\n\nLets create a new file, pipeline.rs and add the following:\nuse bevy::{prelude::*, render::render_resource::*};\n\n#[derive(Resource)]\npub struct GameOfLifePipeline {\n    init_pipeline: CachedComputePipelineId,\n    update_pipeline: CachedComputePipelineId,\n    texture_bind_group_layout: BindGroupLayout,\n}\n\nimpl FromWorld for GameOfLifePipeline {\n    fn from_world(world: &amp;mut World) -&gt; Self {}\n}\n\n\nOur pipeline resource holds the two compute pipeline id's we will be using (init for setup) and (update for each frame). We also need to hold onto\nthe bind group layout.\n\na bind group layout is a way to describe the structure of resources that a shader will access during execution. The resources include buffers, textures, and samplers\n\nLets expand upon our FromWorld implementation.\nimpl FromWorld for GameOfLifePipeline {\n    fn from_world(world: &amp;mut World) -&gt; Self {\n        let texture_bind_group_layout =\n            world\n                .resource::&lt;RenderDevice&gt;()\n                .create_bind_group_layout(&amp;BindGroupLayoutDescriptor {\n                    label: Some(\"Game of Life Bind Group Layout\"),\n                    entries: &amp;[BindGroupLayoutEntry {\n                        binding: 0,\n                        visibility: ShaderStages::COMPUTE,\n                        ty: BindingType::StorageTexture {\n                            access: StorageTextureAccess::ReadWrite,\n                            format: TextureFormat::Rgba8Unorm,\n                            view_dimension: TextureViewDimension::D2,\n                        },\n                        count: None,\n                    }],\n                });\n\n        let pipeline_cache = world.resource::&lt;PipelineCache&gt;();\n        let shader = world\n            .resource::&lt;AssetServer&gt;()\n            .load(\"shaders/game_of_life.wgsl\");\n\n        ...\n\nWHOA! What is this weird layout stuff? First thing first, the RenderDevice is equivalent to wgpu::Device. We are just using the bevy wrapper.\nI like to add labels to all my shader creations, just to make it easier to track bugs when they do arise. This layout is telling the pipeline that at\nbinding(0) we expect there to be a binding of type StorageTexture, that is read_write, and has the format of Rgba8Unorm.\nWe then pull the pipeline cache to create our pipelines and pull our shader from the asset's folder.\nCompute Shaders\n\nA compute shader is simply a shader that allows you to leverage the GPU's parallel computing power for arbitrary tasks. You can use them for anything from creating a texture to running a neural network. I'll get more into how they work in a bit, but for now suffice to say that we're going to use them to create the vertex and index buffers for our terrain.\nAs of writing, compute shaders are still experimental on the web. You can enable them on beta versions of browsers such as Chrome Canary and Firefox Nightly. Because of this I'll cover a method to use a fragment shader to compute the vertex and index buffers after we cover the compute shader method.\n\n    let init_pipeline = pipeline_cache.queue_compute_pipeline(ComputePipelineDescriptor {\n        layout: vec![texture_bind_group_layout.clone()],\n        shader_defs: vec![],\n        shader: shader.clone(),\n        entry_point: Cow::from(\"init\"),\n        push_constant_ranges: Vec::new(),\n        label: Some(std::borrow::Cow::Borrowed(\"Game of Life Init Pipeline\")),\n    });\n    let update_pipeline = pipeline_cache.queue_compute_pipeline(ComputePipelineDescriptor {\n        shader,\n        shader_defs: vec![],\n        entry_point: Cow::from(\"update\"),\n        push_constant_ranges: Vec::new(),\n        layout: vec![texture_bind_group_layout.clone()],\n        label: Some(std::borrow::Cow::Borrowed(\"Game of Life Update Pipeline\")),\n    });\n\n    GameOfLifePipeline {\n        texture_bind_group_layout,\n        init_pipeline,\n        update_pipeline,\n    }\n\nThe init and update pipeline use the same layout and shader. We are not using push constants yet, so we can leave that as an empty vector, same with shader_defs.\nThe important part is the entry_point. This is the name of the function in the shader that will be executed.\nLets quickly setup our shader and then we can move onto the actual compute shader.\n// assets/game_of_life.wgsl\n\n@group(0) @binding(0)\nvar texture: texture_storage_2d&lt;rgba8unorm, read_write&gt;;\n\n@compute @workgroup_size(8, 8, 1)\nfn init(@builtin(global_invocation_id) invocation_id: vec3&lt;u32&gt;, @builtin(num_workgroups) num_workgroups: vec3&lt;u32&gt;) {}\n\n@compute @workgroup_size(8, 8, 1)\nfn update(@builtin(global_invocation_id) invocation_id: vec3&lt;u32&gt;) {}\n\nWe can see that from what we defined in our BindGroupLayoutDescriptor that we define a texture_storage_2d&lt;rgba8unorm, read_write&gt; at binding(0). Looking\nback at our descriptor:\nBindGroupLayoutDescriptor {\n    label: Some(\"Game of Life Bind Group Layout\"),\n    entries: &amp;[BindGroupLayoutEntry {\n        binding: 0,\n        visibility: ShaderStages::COMPUTE,\n        ty: BindingType::StorageTexture {\n            access: StorageTextureAccess::ReadWrite,\n            format: TextureFormat::Rgba8Unorm,\n            view_dimension: TextureViewDimension::D2,\n        },\n        count: None,\n    }],\n}\n\nWe see that our BindGroupLayoutEntry matches what we expect at group(0) binding(0). This has to match 1:1, otherwise wgpu will panic on run.\nAfterwards, we simply just adds our entry points that we defined in the pipeline's. The @workgroup_size is the size of the workgroup that will be\nexecuted on the gpu. Bevy example uses 8.\nLet's add our newly created pipeline resource to the render world. Back in the plugin:\n...\nlet render_app = app.sub_app_mut(RenderApp);\nrender_app.init_resource::&lt;GameOfLifePipeline&gt;();\n\nRunning the example now should produce the same screen, but still no errors. We are getting closer to actually doing something. More in part 2.\nCode can be found on github: Part 1\n","id":"https://n16hth4wkk.github.io/bevy-gol-explore-part-1/","title":"Exploring Bevy Game of life shader (Part 1)"},"https://n16hth4wkk.github.io/bevy-gol-explore-part-2/":{"body":"Now that we have our pipeline descriptors setup, its time to build the bind group.\n\nA BindGroup is a collection of resources such as buffers, textures, and samplers that are bound together and made available\nto shaders during rendering. Bind groups are created by the application and then bound to a specific pipeline layout,\nwhich defines the expected bindings for the resources in the group.\n\nAt the bottom of our pipeline.rs file, lets add the system which will create our bindgroup each render instance.\n...\n\n#[derive(Resource)]\nstruct GameOfLifeImageBindGroup(pub BindGroup);\n\npub fn queue_bind_group(\n    mut commands: Commands,\n    render_device: Res&lt;RenderDevice&gt;,\n    pipeline: Res&lt;GameOfLifePipeline&gt;,\n    gpu_images: Res&lt;RenderAssets&lt;Image&gt;&gt;,\n    game_of_life_image: Res&lt;GameOfLifeImage&gt;,\n) {\n    let view = &amp;gpu_images[&amp;game_of_life_image.0];\n}\n\n\nStarting off we pull in RenderDevice which is used to create all wgpu resources. RenderAssets&lt;Image&gt; is a resource holding all the GPU representations\nof RenderAssets as long as they exist. We use the handle from the image we created as our canvas, to get the GpuImage. Now the bind group:\n...\nlet bind_group = render_device.create_bind_group(&amp;BindGroupDescriptor {\n    label: Some(\"Game of Life Bind Group\"),\n    layout: &amp;pipeline.texture_bind_group_layout,\n    entries: &amp;[BindGroupEntry {\n        binding: 0,\n        resource: BindingResource::TextureView(&amp;view.texture_view),\n    }],\n});\ncommands.insert_resource(GameOfLifeImageBindGroup(bind_group));\n\nWell this looks really familar! It is an exact replica of the bind_group_layout we created earlier. The only difference is that we are now adding\nthe actual resources that the layout expects. In this case we are adding the texture view of our canvas image. Lets add the system to our render app.\n...\nlet render_app = app.sub_app_mut(RenderApp);\n        render_app\n            .init_resource::&lt;GameOfLifePipeline&gt;()\n            .add_system(pipeline::queue_bind_group.in_set(RenderSet::Queue));\n\nWe add our system to the set RenderSet::Queue which create BindGroups that depend on Prepare data and queue up draw calls to run during the Render step.\nIf you try running the app, it will currently crash with the following error:\nResource requested by game_of_life_sim::pipeline::queue_bind_group does not exist: game_of_life_sim::image::GameOfLifeImage\nOops! We forgot to tell bevy render world how to access our Image which exist on the main world. Let's add the ExtractResourcePlugin which just\nextracts the resources into the \"render world\".\napp.add_plugin(FrameTimeDiagnosticsPlugin::default())\n    // Extract the game of life image resource from the main world into the render world\n    // for operation on by the compute shader and display on the sprite.\n    .add_plugin(ExtractResourcePlugin::&lt;GameOfLifeImage&gt;::default())\n    ...\n\nIf you run again, no errors! Awesome :D. Now onto nodes and the render graph. This was new to me after I setup wgpu manually in my other projects. If you are curious,\nthis is the docstring attached to the RenderGraph resource:\n\nThe RenderGraph configures the modular, parallel and re-usable render logic. It is a retained and stateless (nodes themselves may have their own\ninternal state) structure, which can not be modified while it is executed by the graph runner.\nThe RenderGraphRunner is responsible for executing the entire graph each frame. It consists of three main components: Nodes, Edges and Slots.\nNodes are responsible for generating draw calls and operating on input and output slots. Edges specify the order of execution for nodes and connect input and output slots together.\nSlots describe the render resources created or used by the nodes.\nAdditionally a render graph can contain multiple sub graphs, which are run by the corresponding nodes. Every render graph can have its own optional input node.\n\nEssentially we setup a graph to tell the render world how to run our pipelines. We only have a single pipeline currnetly, so we will only need a single node.\nOur node will have a state for processing which stage the shader is currently in: Loading, Init, Update. Back in pipeline.rs lets add our node:\n...\npub enum GameOfLifeState {\n    Loading,\n    Init,\n    Update,\n}\n\npub struct GameOfLifeNode {\n    state: GameOfLifeState,\n}\n\nimpl Default for GameOfLifeNode {\n    fn default() -&gt; Self {\n        Self {\n            state: GameOfLifeState::Loading,\n        }\n    }\n}\n\nLets add the node to our render app:\nlet render_app = app.sub_app_mut(RenderApp);\nrender_app\n    .init_resource::&lt;GameOfLifePipeline&gt;()\n    .add_system(pipeline::queue_bind_group.in_set(RenderSet::Queue));\n\nlet mut render_graph = render_app.world.resource_mut::&lt;RenderGraph&gt;();\nrender_graph.add_node(\"game_of_life\", GameOfLifeNode::default());\nrender_graph.add_node_edge(\n    \"game_of_life\",\n    bevy::render::main_graph::node::CAMERA_DRIVER,\n);\n\nWe add the node to the render graph and then add an edge to the camera driver. This will tell the render graph to run our node before the camera driver.\nOur node starts in the Loading state. We now have to impl bevy's render_graph::Node: The trait is defined as follow:\npub trait Node: Downcast + Send + Sync + 'static {\n    /// Specifies the required input slots for this node.\n    /// They will then be available during the run method inside the [`RenderGraphContext`].\n    fn input(&amp;self) -&gt; Vec&lt;SlotInfo&gt; {\n        Vec::new()\n    }\n\n    /// Specifies the produced output slots for this node.\n    /// They can then be passed one inside [`RenderGraphContext`] during the run method.\n    fn output(&amp;self) -&gt; Vec&lt;SlotInfo&gt; {\n        Vec::new()\n    }\n\n    /// Updates internal node state using the current render [`World`] prior to the run method.\n    fn update(&amp;mut self, _world: &amp;mut World) {}\n\n    /// Runs the graph node logic, issues draw calls, updates the output slots and\n    /// optionally queues up subgraphs for execution. The graph data, input and output values are\n    /// passed via the [`RenderGraphContext`].\n    fn run(\n        &amp;self,\n        graph: &amp;mut RenderGraphContext,\n        render_context: &amp;mut RenderContext,\n        world: &amp;World,\n    ) -&gt; Result&lt;(), NodeRunError&gt;;\n}\n\nThe input defines required input slots and output defines produced output slots. This will exist on the RenderGraphContext. Our example doesn't\nuse either, so we don't care for the graph context.\nimpl render_graph::Node for GameOfLifeNode {\n    fn update(&amp;mut self, world: &amp;mut World) {\n        let pipeline = world.resource::&lt;GameOfLifePipeline&gt;();\n        let pipeline_cache = world.resource::&lt;PipelineCache&gt;();\n\n        // if the corresponding pipeline has loaded, transition to the next stage\n        match self.state {\n            GameOfLifeState::Loading =&gt; {\n                if let CachedPipelineState::Ok(_) =\n                    pipeline_cache.get_compute_pipeline_state(pipeline.init_pipeline)\n                {\n                    self.state = GameOfLifeState::Init;\n                }\n            }\n            GameOfLifeState::Init =&gt; {\n                if let CachedPipelineState::Ok(_) =\n                    pipeline_cache.get_compute_pipeline_state(pipeline.update_pipeline)\n                {\n                    self.state = GameOfLifeState::Update;\n                }\n            }\n            GameOfLifeState::Update =&gt; {}\n        }\n    }\n\n    fn run(\n        &amp;self,\n        _graph: &amp;mut render_graph::RenderGraphContext,\n        render_context: &amp;mut RenderContext,\n        world: &amp;World,\n    ) -&gt; Result&lt;(), render_graph::NodeRunError&gt; {\n        Ok(())\n    }\n}\n\nLets focus on the update method. We are checking if the pipeline has loaded. If it has, we transition to the next stage. For update,\nwe have no other state to transition to, but if you needed to recreate your pipeline or rerun your init pipeline, you would do change the state here.\nThe fun stuff: run. This is where we will be running our compute shaders. Let's setup the init pipeline first:\nfn run(\n        &amp;self,\n        _graph: &amp;mut render_graph::RenderGraphContext,\n        render_context: &amp;mut RenderContext,\n        world: &amp;World,\n    ) -&gt; Result&lt;(), render_graph::NodeRunError&gt; {\n        let texture_bind_group = &amp;world.resource::&lt;GameOfLifeImageBindGroup&gt;().0;\n        let pipeline_cache = world.resource::&lt;PipelineCache&gt;();\n        let pipeline = world.resource::&lt;GameOfLifePipeline&gt;();\n        ...\n\nWe have to pull 3 resources from the world: GameOfLifeImageBindGroup, PipelineCache, and GameOfLifePipeline. We are already familiar\nwith the pipeline and pipeline cache, but the new resource GameOfLifeImageBindGroup is a BindGroup that we queue each frame to be used by the shader.\nNow we beging the ComputePass.\n...\nlet mut pass = render_context\n    .command_encoder()\n    .begin_compute_pass(&amp;ComputePassDescriptor::default());\n...\n\nSince we are only using compute shaders, we need to begin a compute pass, the other side of the coin is a render pass for vertex and fragment shaders.\n...\npass.set_bind_group(0, texture_bind_group, &amp;[]);\n...\n\nAssign our bindgroup the the compute pass. Then we pull the state defined from our node to see which piplline to execute.\n// select the pipeline based on the current state\nmatch self.state {\n    GameOfLifeState::Update | GameOfLifeState::Loading =&gt; {}\n    GameOfLifeState::Init =&gt; {\n        let init_pipeline = pipeline_cache\n            .get_compute_pipeline(pipeline.init_pipeline)\n            .unwrap();\n        pass.set_pipeline(init_pipeline);\n        pass.dispatch_workgroups(\n            SIM_SIZE.0 / WORKGROUP_SIZE,\n            SIM_SIZE.1 / WORKGROUP_SIZE,\n            1,\n        );\n    }\n}\n\nWe are skipping the update pipeline currently, but we will come back to it. For the init state, we want to run the init pipeline. We set the pipeline using our\nCachedComputePipelineId defined in our GameOfLifePipeline. Then we dispatch the workgroups. The function takes 3 arguments: x, y, z. In our shader,\nwe defined our workgroup size as 8x8x1. @compute @workgroup_size(8, 8, 1)\nA visual representation of work groups: Work Groups.\nIt may be helpful to think of a compute shader as a function that is run in a bunch of nested for loops, but each loop is executed in parallel. It would look something like this:\nfor wgx in num_workgroups.x:\n    for wgy in num_workgroups.y:\n        for wgz in num_workgroups.z:\n            var local_invocation_id = (wgx, wgy, wgz)\n            for x in workgroup_size.x:\n                for y in workgroup_size.x:\n                    for z in workgroup_size.x:\n\nRunning still produces the same black screen, but I promise the init pipeline triggered once, we just need to add code to our shader now! Bevy uses wgpu internally,\nwhich uses wgsl as their default shader language. They also support GLSL, but a word of warning, there can be some weird quirks when using GLSL with wgpu.\nTo start with our init function in our shader, we see some function inputs:\nfn init(@builtin(global_invocation_id) invocation_id: vec3&lt;u32&gt;, @builtin(num_workgroups) num_workgroups: vec3&lt;u32&gt;) \n\nThis is a builtin value for the current invocationâ€™s global invocation ID, i.e. its position in the compute shader grid. WGSL has many builtin values\nand functions. Please refer to the spec for more info WebGPU Shading Language.\nAnd the num_workgroups is the number of workgroups in each dimension.\nfn init(@builtin(global_invocation_id) invocation_id: vec3&lt;u32&gt;, @builtin(num_workgroups) num_workgroups: vec3&lt;u32&gt;) {\n    let location = vec2&lt;i32&gt;(invocation_id.xy);\n}\n\nWe can get the current location within the shader by casting the invocation.xy to an i32.\n\ninvocation.xy is short hand for invocation.x and invocation.y\n\nWe want to randomize our initial state, so lets define a random function.\nfn hash(value: u32) -&gt; u32 {\n    var state = value;\n    state = state ^ 2747636419u;\n    state = state * 2654435769u;\n    state = state ^ state &gt;&gt; 16u;\n    state = state * 2654435769u;\n    state = state ^ state &gt;&gt; 16u;\n    state = state * 2654435769u;\n    return state;\n}\n\nfn randomFloat(value: u32) -&gt; f32 {\n    return f32(hash(value)) / 4294967295.0;\n}\n\nThere are many hash / random functions you can find online. Each with their own pros and cons. I am just using the bevy default.\n\n2654435769u is a inline cast like in rust with 2654435769_u32. The u is for u32.\n\nlet randomNumber = randomFloat(invocation_id.y * num_workgroups.x + invocation_id.x);\nlet alive = randomNumber &gt; 0.9;\n\nWe generate a random number, and if it is greater than 0.9, we set the cell to alive. We can now set the cell in our texture. Play around with what denotes\nand alive cell. Lowering 0.9 will generate more alive cells and vice versa. Lets finish off the init.\nfn init(@builtin(global_invocation_id) invocation_id: vec3&lt;u32&gt;, @builtin(num_workgroups) num_workgroups: vec3&lt;u32&gt;) {\n    let location = vec2&lt;i32&gt;(invocation_id.xy);\n\n    let randomNumber = randomFloat(invocation_id.y * num_workgroups.x + invocation_id.x);\n    let alive = randomNumber &gt; 0.9;\n    let color = vec4&lt;f32&gt;(f32(alive));\n\n    textureStore(texture, location, color);\n}\n\nYou might be curious what vec4&lt;f32&gt;(f32(alive)) is doing here. vec4&lt;f32&gt;() is casting the value to a vec4&lt;f32&gt;. We are using the f32() function to cast\nthe alive value from a bool to a f32. So if alive the color will be vec4&lt;f32&gt;(1.0) or (1.0,1.0,1.0,1.0) and if dead vec4&lt;f32&gt;(0.0) or (0.0,0.0,0.0,0.0).\nAnd now the moment of truth, we can run our code and see the results! Running should produce something like this:\n\n  \n\nCode can be found on github: Part 2\n","id":"https://n16hth4wkk.github.io/bevy-gol-explore-part-2/","title":"Exploring Bevy Game of life shader (Part 2)"},"https://n16hth4wkk.github.io/bevy-gol-explore-part-3/":{"body":"It is exciting to finally see some progress after so much boilerplate! Let's change up the color scheme a bit! I like the color red, so let's make the\nalive cells red. In our shader, switch the init_pipeline color to the following:\n@compute @workgroup_size(8, 8, 1)\nfn init(@builtin(global_invocation_id) invocation_id: vec3&lt;u32&gt;, @builtin(num_workgroups) num_workgroups: vec3&lt;u32&gt;) {\n    let location = vec2&lt;i32&gt;(invocation_id.xy);\n\n    let randomNumber = randomFloat(invocation_id.y * num_workgroups.x + invocation_id.x);\n    let alive = randomNumber &gt; 0.9;\n    let color = vec4&lt;f32&gt;(f32(alive), 0.0, 0.0, 1.0); // NEW\n\n    textureStore(texture, location, color);\n}\n\nAnd you should see something like this:\n\n  \n\nVery red! Now onto our update pipeline, which makes all this worth it to see the cells move.\nUpdate Pipeline\nBack in pipeline.rs lets update our match statement within the run function of our node.\n// select the pipeline based on the current state\nmatch self.state {\n    GameOfLifeState::Loading =&gt; {}\n    GameOfLifeState::Init =&gt; {\n        let init_pipeline = pipeline_cache\n            .get_compute_pipeline(pipeline.init_pipeline)\n            .unwrap();\n        pass.set_pipeline(init_pipeline);\n        pass.dispatch_workgroups(\n            SIM_SIZE.0 / WORKGROUP_SIZE,\n            SIM_SIZE.1 / WORKGROUP_SIZE,\n            1,\n        );\n    }\n    GameOfLifeState::Update =&gt; {\n        let update_pipeline = pipeline_cache\n            .get_compute_pipeline(pipeline.update_pipeline)\n            .unwrap();\n        pass.set_pipeline(update_pipeline);\n        pass.dispatch_workgroups(\n            SIM_SIZE.0 / WORKGROUP_SIZE,\n            SIM_SIZE.1 / WORKGROUP_SIZE,\n            1,\n        );\n    }\n}\n\nIt is exactly the same as the init pipeline, we just use the update pipeline instead. That takes care of the rust side of things, now onto the shader.\nConway's Game of Life\nThe particular bit of cellular automata we are implementing is Conway's Game of Life. The rules are as follows:\n\nAny live cell with fewer than two live neighbours dies, as if by underpopulation.\nAny live cell with two or three live neighbours lives on to the next generation.\nAny live cell with more than three live neighbours dies, as if by overpopulation.\nAny dead cell with exactly three live neighbours becomes a live cell, as if by reproduction.\n\nThese rules, which compare the behaviour of the automaton to real life, can be condensed into the following:\n\nAny live cell with two or three live neighbours survives.\nAny dead cell with three live neighbours becomes a live cell.\nAll other live cells die in the next generation. Similarly, all other dead cells stay dead.\n\nBack in our update fn, lets start by pulling the current location\n@compute @workgroup_size(8, 8, 1)\nfn update(@builtin(global_invocation_id) invocation_id: vec3&lt;u32&gt;) {\n    let location = vec2&lt;i32&gt;(invocation_id.xy);\n}\n\nNow we need to count the number of alive neighbors, but to do that, we need a way to tell if a cell is alive or dead.\nAdd the following utility function\n...\nfn is_alive(location: vec2&lt;i32&gt;, offset_x: i32, offset_y: i32) -&gt; u32 {\n    let value: vec4&lt;f32&gt; = textureLoad(texture, location + vec2&lt;i32&gt;(offset_x, offset_y));\n    return u32(value.x);\n}\n...\n\nThis function takes in a location, and an offset. We store all our data within the texture itself as colors. (in our instance its red colors for alive \nand black for dead). textureLoad loads the color at the given location. We know a cell is alive if the color returned is red, which is a value of 1.0 a x\nNow that we have a way to tell if a cell is alive, we can move onto counting the neighbors. We need to check the 8 cells surrounding the current cell.\nWe can acheive this using a simple nested for loop. Here is what I came up with:\nfn count_neighbors_simple(location: vec2&lt;i32&gt;) -&gt; u32 {\n    var result: u32 = 0u;\n    for (var x: i32 = -1; x &lt; 2; x++) {\n        for (var y: i32 = -1; y &lt; 2; y++) {\n            if x == 0 &amp;&amp; y == 0 {\n                continue;\n            }\n\n            result += is_alive(location, x, y); \n        }\n    }\n    return result;\n}\n\nWe take in a location to count the neighbors of, and return the number of alive neighbors by looping through the 8 surrounding cells\nand calling our is_alive function. Lets add this to our update function:\n@compute @workgroup_size(8, 8, 1)\nfn update(@builtin(global_invocation_id) invocation_id: vec3&lt;u32&gt;) {\n    let location = vec2&lt;i32&gt;(invocation_id.xy);\n    let is_alive = bool(is_alive(location, 0, 0));\n    let num_neighbors = count_neighbors_simple(location);\n}\n\nIt is pretty staight forward from here, we just need to implement the rules from above.\n...\n\nvar result: u32 = 0u;\n\nif (is_alive) { \n    result = ((u32((num_neighbors) == (2u))) | (u32((num_neighbors) == (3u)))); \n} else { \n    result = u32((num_neighbors) == (3u)); \n}\n\nlet color = vec4&lt;f32&gt;(f32(result), 0.0, 0.0, 1.0);\ntextureStore(texture, location, color);\n\nIf the current cell is alive, we check if it has 2 or 3 neighbors, if it does, it lives on, otherwise it dies. If the current cell is dead,\nwe check if it has 3 neighbors, if it does, it becomes alive, otherwise it stays dead. Then we store our result as a color in the texture (red in this case).\n\nNote: I removed the window_fps plugin and FrameTimeDiagnosticsPlugin plugin. It was slowing down my app when running.\nI also disabled bevy::window::PresentMode::AutoNoVsync otherwise, the app runs at like 3k fps XD\n\nRunning the app should now show the cells moving around!!! How cool!\n\n  \n\nCode can be found on github: Part 3\n","id":"https://n16hth4wkk.github.io/bevy-gol-explore-part-3/","title":"Exploring Bevy Game of life shader (Part 3)"},"https://n16hth4wkk.github.io/bevy-gol-explore-part-4/":{"body":"I promised some additions to the original example provided so lets start with the easiest one, a simple camera controller.\nI just want to be able to pan around the simulation and zoom in a bit. I am going to run a cleanup and refactor for readability and\ncleanliness.\n\nCreate three new files, camera.rs, input.rs, and utils.rs, along with the a foldr pipeline. It is important the pipeline folder is named exactly\nas the pipeline.rs file as I am not using mod.rs files.\nMove the function create_image into our utils folder and delete the image file.\nInside pipeline folder create a automata.rs file and move all the pipeline code from our past\nthree posts into it. This includes the Pipeline, TextureBindGroup, State, and Node.\n\n\nI also renamed some things. Here is a mapping:\n\nPipeline -&gt; AutomataPipeline\nGameOfLifeImageBindGroup -&gt; AutomataTextureBindGroup\nGameOfLifeState -&gt; AutomataState\nGameOfLifeNode -&gt; AutomataNode\n\nLets add a simple plugin to host from this file at the top:\n\n#[derive(Resource, Clone, Deref, ExtractResource)]\npub struct GameOfLifeImage(pub Handle&lt;Image&gt;);\n\npub struct AutomataPipelinePlugin;\nimpl Plugin for AutomataPipelinePlugin {\n    fn build(&amp;self, render_app: &amp;mut App) {\n        render_app\n            .init_resource::&lt;GameOfLifeAutomataPipeline&gt;()\n            .add_system(queue_automata_bind_group.in_set(RenderSet::Queue));\n    }\n}\n\nBack in the pipeline.rs file, it should be empty, so lets add another plugin to host all pipeline plugins.\npub struct PipelinesPlugin;\nimpl Plugin for PipelinesPlugin {\n    fn build(&amp;self, app: &amp;mut App) {\n        let render_app = app.sub_app_mut(RenderApp);\n        render_app\n            .add_plugin(automata::AutomataPipelinePlugin);\n\n        let mut render_graph = render_app.world.resource_mut::&lt;RenderGraph&gt;();\n        let gol_id = render_graph.add_node(\"game_of_life\", automata::AutomataNode::default());\n\n        /*\n         * Automata Pipeline =&gt; Camera Driver\n         */\n        render_graph.add_node_edge(gol_id, bevy::render::main_graph::node::CAMERA_DRIVER);\n    }\n}\n\nWe are moving the render_app implementation from our ShaderPlaygroundPlugin to this new PipelinesPlugin.\nDon't forget to add the PipelinesPlugin to the ShaderPlaygroundPlugin in lib.rs!\nCamera\nOnto setting up a camera controller.\nconst CAMERA_MOVE_SPEED: f32 = 500.0;\n\npub struct CameraPlugin;\nimpl Plugin for CameraPlugin {\n    fn build(&amp;self, app: &amp;mut App) {\n        app.add_system(camera_controller);\n    }\n}\n\nfn camera_controller(\n    time: Res&lt;Time&gt;,\n    keyboard_input: Res&lt;Input&lt;KeyCode&gt;&gt;,\n    mut mouse_wheel_events: EventReader&lt;MouseWheel&gt;,\n    mut query: Query&lt;(&amp;mut Transform, &amp;mut OrthographicProjection), With&lt;Camera&gt;&gt;,\n) {\n    for (mut transform, mut ortho) in query.iter_mut() {\n        let up = keyboard_input.pressed(KeyCode::W);\n        let down = keyboard_input.pressed(KeyCode::S);\n        let left = keyboard_input.pressed(KeyCode::A);\n        let right = keyboard_input.pressed(KeyCode::D);\n\n        let x_axis = right as i8 - left as i8;\n        let y_axis = up as i8 - down as i8;\n        let mut move_delta = Vec2::new(x_axis as f32, y_axis as f32);\n\n        // =========== Move the camera around =========== //\n        if move_delta != Vec2::ZERO {\n            move_delta /= move_delta.length();\n\n            let z = transform.translation.z;\n            transform.translation +=\n                move_delta.extend(z) * CAMERA_MOVE_SPEED * time.delta_seconds();\n\n            // Important! We need to restore the Z values when moving the camera around.\n            // Bevy has a specific camera setup and this can mess with how our layers are shown.\n            transform.translation.z = z;\n        }\n\n        // =========== Zoom =========== //\n        for MouseWheel { x, y, unit } in mouse_wheel_events.iter() {\n            let mut x_scroll_diff = 0.0;\n            let mut y_scroll_diff = 0.0;\n\n            match unit {\n                MouseScrollUnit::Line =&gt; {\n                    x_scroll_diff += x;\n                    y_scroll_diff += y;\n                }\n                MouseScrollUnit::Pixel =&gt; {\n                    // I just took this from three-rs, no idea why this magic number was chosen Â¯\\_(ãƒ„)_/Â¯\n                    const PIXELS_PER_LINE: f32 = 38.0;\n\n                    y_scroll_diff += y / PIXELS_PER_LINE;\n                    x_scroll_diff += x / PIXELS_PER_LINE;\n                }\n            }\n\n            if x_scroll_diff != 0.0 || y_scroll_diff != 0.0 {\n                if y_scroll_diff &lt; 0.0 {\n                    ortho.scale *= 1.05;\n                } else {\n                    ortho.scale *= 1.0 / 1.05;\n                }\n\n                ortho.scale = ortho.scale.clamp(0.15, 5.);\n            }\n        }\n    }\n}\n...\n\n// in our ShaderPlaygroundPlugin\n\napp\n    // Extract the game of life image resource from the main world into the render world\n    // for operation on by the compute shader and display on the sprite.\n    .add_plugin(ExtractResourcePlugin::&lt;GameOfLifeImage&gt;::default())\n    .add_plugin(camera::CameraPlugin)\n    .add_startup_system(setup);\n...\n\nA simple camera controller. We generate a move delta based on the pressed keys and then using bevy's builtin time resource, manipulate the\ncamera's position for buttery smooth movement. Adjust the movement constant to your liking. The zoom just listens for scroll events and adjusts\nthe orthographic projection's scale. The MouseScrollUnit::Pixel case is taken from an online example I found. I don't know what triggers a\nMouseScrollUnit::Pixel, but I have only seen Line units so far, but better safe than sorry!\nTo better see that our camera works well, you can replace the ClearColor(Color::BLACK) with ClearColor(Color::WHITE).\nYou should now be able to pan aroundthe simulation and also zoom!You should now be able to pan around\n\n  \n\nThe main thing I want this part to focus on would be drawing onto our canvas. We will be using ANOTHER ;) compute pipeline to handle this for us.\nLets setup the mouse positioning system that will be used.\nSetting up our input bindings lets fill out input.rs file.\nWe need a resource to hold our mouse position, previous mouse position, and if our mouse button is down.\npub struct InputPlugin;\nimpl Plugin for InputPlugin {\n    fn build(&amp;self, app: &amp;mut App) {\n        app.init_resource::&lt;InputState&gt;();\n    }\n}\n\n#[derive(Default, Resource, ExtractResource, Clone)]\npub struct InputState {\n    mouse_pos: Vec2,\n    prev_mouse_pos: Vec2,\n    left_button_down: bool,\n}\n\nimpl InputState {\n    pub fn mouse_canvas_pos(&amp;self) -&gt; Vec2 {\n        self.mouse_pos\n    }\n\n    pub fn prev_mouse_canvas_pos(&amp;self) -&gt; Vec2 {\n        self.prev_mouse_pos\n    }\n\n    pub fn is_drawing(&amp;self) -&gt; bool {\n        self.left_button_down\n    }\n}\n\npub fn update_input_state(\n    window_query: Query&lt;&amp;Window&gt;,\n    mut input_state: ResMut&lt;InputState&gt;,\n    camera_q: Query&lt;(&amp;Camera, &amp;GlobalTransform)&gt;,\n    mut mouse_button_input_events: EventReader&lt;MouseButtonInput&gt;,\n) {\n    let Ok(primary_window) = window_query.get_single() else { return };\n    // get the camera info and transform\n    let Ok((camera, camera_transform)) = camera_q.get_single() else { return };\n\n    // Determine button state\n    for event in mouse_button_input_events.iter() {\n        if event.button == MouseButton::Left {\n            input_state.left_button_down = event.state == ButtonState::Pressed;\n        }\n    }\n    ...\n}\n\nMouse button is a simple event reader. The previous and current mouse position is a bit more complicated as we need to convert from world space to canvas space.\nif let Some(world_position) = primary_window\n    .cursor_position()\n    .and_then(|cursor| camera.viewport_to_world(camera_transform, cursor))\n    .map(|ray| ray.origin.truncate())\n{\n}\n\nGrabbing the world_position from the window and camera is ripped from the bevy cheatbook. Now\nthat we have the world coordinates, we need a way to transform them into curstor coordinates. In utils add a function:\nuse bevy::prelude::Vec2;\n\npub fn world_pos_to_canvas_pos(world_pos: Vec2) -&gt; Vec2 {\n    world_pos\n        + Vec2::new(\n            crate::SIM_SIZE.0 as f32 / 2.0,\n            crate::SIM_SIZE.1 as f32 / 2.0,\n        )\n}\n\nThis just takes the world position and adds half the size of the canvas to it. Finish off the input system.\nif let Some(world_position) = primary_window\n    .cursor_position()\n    .and_then(|cursor| camera.viewport_to_world(camera_transform, cursor))\n    .map(|ray| ray.origin.truncate())\n{\n    input_state.prev_mouse_pos = input_state.mouse_pos; // NEW\n    input_state.mouse_pos =\n        crate::utils::world_pos_to_canvas_pos(world_position * Vec2::new(1.0, -1.0)); // NEW\n}\n\nworld_position * Vec2::new(1.0, -1.0) is just flipping the y axis since images have y going down and wgpu has y going up.\nAdd the input plugin to the ShaderPlaygroundPlugin.\nDraw Pipeline\nWe are going to need bytemuck so add that to your project with cargo add bytemuck.\nAdd a new file in pipeline folder called draw. This is going to look really similar to the automata setup, just with a few minor tweaks.\npub struct AutomataDrawPipelinePlugin;\nimpl Plugin for AutomataDrawPipelinePlugin {\n    fn build(&amp;self, render_app: &amp;mut App) {\n        render_app\n            .init_resource::&lt;AutomataDrawPipeline&gt;()\n            .add_system(queue_draw_bind_group.in_set(RenderSet::Queue));\n    }\n}\n\n// ================================== Contants ================================== //\n\n#[repr(C)]\n#[derive(Copy, Clone, bytemuck::Pod, bytemuck::Zeroable)]\npub struct AutomataPushConstants {\n    draw_start: [f32; 2],\n    draw_end: [f32; 2],\n    draw_radius: f32,\n}\n\nimpl AutomataPushConstants {\n    pub fn new(draw_start: Vec2, draw_end: Vec2, draw_radius: f32) -&gt; Self {\n        Self {\n            draw_radius,\n            draw_end: draw_end.to_array(),\n            draw_start: draw_start.to_array(),\n        }\n    }\n}\n\nThis new struct holds our push constants that we will pass to our draw pipeline shader.\n\nPushConstants are a way to pass data to a shader without having to create a buffer. The downside is that the data is limited and is much smaller\nthan the limit on buffers. The upside is that it is faster than buffers.\n\n\n// ================================== Pipeline ================================== //\n\n#[derive(Resource)]\npub struct AutomataDrawPipeline {\n    draw_pipeline: CachedComputePipelineId,\n    draw_bind_group_layout: BindGroupLayout,\n}\n\nimpl FromWorld for AutomataDrawPipeline {\n    fn from_world(world: &amp;mut World) -&gt; Self {\n        let pipeline_cache = world.resource::&lt;PipelineCache&gt;();\n\n        let draw_bind_group_layout =\n            world\n                .resource::&lt;RenderDevice&gt;()\n                .create_bind_group_layout(&amp;BindGroupLayoutDescriptor {\n                    label: Some(\"Game of Life Bind Group Layout\"),\n                    entries: &amp;[BindGroupLayoutEntry {\n                        binding: 0,\n                        visibility: ShaderStages::COMPUTE,\n                        ty: BindingType::StorageTexture {\n                            access: StorageTextureAccess::ReadWrite,\n                            format: TextureFormat::Rgba8Unorm,\n                            view_dimension: TextureViewDimension::D2,\n                        },\n                        count: None,\n                    }],\n                });\n\n        let brush_shader = world.resource::&lt;AssetServer&gt;().load(\"shaders/draw.wgsl\");\n\n        let draw_pipeline = pipeline_cache.queue_compute_pipeline(ComputePipelineDescriptor {\n            shader: brush_shader,\n            shader_defs: vec![],\n            entry_point: Cow::from(\"draw\"),\n            layout: vec![draw_bind_group_layout.clone()],\n            label: Some(std::borrow::Cow::Borrowed(\"Game of Life Draw Pipeline\")),\n            push_constant_ranges: [PushConstantRange {\n                stages: ShaderStages::COMPUTE,\n                range: 0..std::mem::size_of::&lt;AutomataPushConstants&gt;() as u32,\n            }]\n            .to_vec(),\n        });\n\n        AutomataDrawPipeline {\n            draw_pipeline,\n            draw_bind_group_layout,\n        }\n    }\n}\n\nOur draw_pipeline has a new value: push_constant_ranges. The push_constant_ranges is a range of bytes that can be passed to the shader via PushConstants.\n// ================================== BindGroup ================================== //\n\n#[derive(Resource)]\nstruct AutomataDrawBindGroup(pub BindGroup);\n\npub fn queue_draw_bind_group(\n    mut commands: Commands,\n    render_device: Res&lt;RenderDevice&gt;,\n    pipeline: Res&lt;AutomataDrawPipeline&gt;,\n    gpu_images: Res&lt;RenderAssets&lt;Image&gt;&gt;,\n    game_of_life_image: Res&lt;GameOfLifeImage&gt;,\n) {\n    let view = &amp;gpu_images[&amp;game_of_life_image.0];\n    let draw_bind_group = render_device.create_bind_group(&amp;BindGroupDescriptor {\n        label: Some(\"Game of Life Draw Bind Group\"),\n        layout: &amp;pipeline.draw_bind_group_layout,\n        entries: &amp;[BindGroupEntry {\n            binding: 0,\n            resource: BindingResource::TextureView(&amp;view.texture_view),\n        }],\n    });\n    commands.insert_resource(AutomataDrawBindGroup(draw_bind_group));\n}\n\n// ================================== Nodes ================================== //\npub enum AutomataDrawState {\n    Loading,\n    Update,\n}\n\npub struct AutomataDrawNode {\n    state: AutomataDrawState,\n}\n\nimpl Default for AutomataDrawNode {\n    fn default() -&gt; Self {\n        Self {\n            state: AutomataDrawState::Loading,\n        }\n    }\n}\n\nOur node only has two states: Loading and Update as we don't need to initialize anything.\nimpl render_graph::Node for AutomataDrawNode {\n    fn update(&amp;mut self, world: &amp;mut World) {\n        let pipeline_cache = world.resource::&lt;PipelineCache&gt;();\n        let pipeline = world.resource::&lt;AutomataDrawPipeline&gt;();\n\n        // if the corresponding pipeline has loaded, transition to the next stage\n        match self.state {\n            AutomataDrawState::Loading =&gt; {\n                if let CachedPipelineState::Ok(_) =\n                    pipeline_cache.get_compute_pipeline_state(pipeline.draw_pipeline)\n                {\n                    self.state = AutomataDrawState::Update;\n                }\n            }\n            AutomataDrawState::Update =&gt; {}\n        }\n    }\n\n    fn run(\n        &amp;self,\n        _graph: &amp;mut render_graph::RenderGraphContext,\n        render_context: &amp;mut RenderContext,\n        world: &amp;World,\n    ) -&gt; Result&lt;(), render_graph::NodeRunError&gt; {\n        let input_state = &amp;world.resource::&lt;InputState&gt;();\n\n        if input_state.is_drawing() {\n            let texture_bind_group = &amp;world.resource::&lt;AutomataTextureBindGroup&gt;().0;\n            let draw_bind_group = &amp;world.resource::&lt;AutomataDrawBindGroup&gt;().0;\n            let pipeline_cache = world.resource::&lt;PipelineCache&gt;();\n            let pipeline = world.resource::&lt;AutomataDrawPipeline&gt;();\n\n            let mut pass = render_context\n                .command_encoder()\n                .begin_compute_pass(&amp;ComputePassDescriptor::default());\n\n            pass.set_bind_group(0, texture_bind_group, &amp;[]);\n\n            // select the pipeline based on the current state\n            match self.state {\n                AutomataDrawState::Loading =&gt; {}\n                AutomataDrawState::Update =&gt; {\n                    let draw_pipeline = pipeline_cache\n                        .get_compute_pipeline(pipeline.draw_pipeline)\n                        .unwrap();\n\n                    let pc = AutomataPushConstants::new(\n                        input_state.mouse_canvas_pos(),\n                        input_state.prev_mouse_canvas_pos(),\n                        10.0,\n                    );\n\n                    pass.set_pipeline(draw_pipeline);\n                    pass.set_bind_group(0, draw_bind_group, &amp;[]);\n                    pass.set_push_constants(0, bytemuck::cast_slice(&amp;[pc]));\n                    pass.dispatch_workgroups(\n                        SIM_SIZE.0 / WORKGROUP_SIZE,\n                        SIM_SIZE.1 / WORKGROUP_SIZE,\n                        1,\n                    );\n                }\n            }\n        }\n\n        Ok(())\n    }\n}\n\nInside our run, we first check to see if we are drawing at all. If so, we pull the current mouse position as well as the previous mouse position and instantiate the AutomataPushConstants with a radius of 10.0.\nWe then setup the pipeline and add the push constants with bytemuck::cast_slice.\nWith that, our draw pipeline is complete and ready. Lets add it to our pipelines plugin:\nimpl Plugin for PipelinesPlugin {\n    fn build(&amp;self, app: &amp;mut App) {\n        let render_app = app.sub_app_mut(RenderApp);\n        render_app\n            .add_plugin(draw::AutomataDrawPipelinePlugin)\n            .add_plugin(automata::AutomataPipelinePlugin);\n\n        let mut render_graph = render_app.world.resource_mut::&lt;RenderGraph&gt;();\n        let gol_id = render_graph.add_node(\"game_of_life\", automata::AutomataNode::default());\n        let draw_id = render_graph.add_node(\"game_of_life_draw\", draw::AutomataDrawNode::default());\n        ...\n\nWe now have a new node to use in our render graph! We want the draw_node to run  before our automata_node.\nlet mut render_graph = render_app.world.resource_mut::&lt;RenderGraph&gt;();\nlet gol_id = render_graph.add_node(\"game_of_life\", automata::AutomataNode::default());\nlet draw_id = render_graph.add_node(\"game_of_life_draw\", draw::AutomataDrawNode::default());\n\n/*\n* Draw Pipeline =&gt; Automata Pipeline =&gt; Camera Driver\n*/\nrender_graph.add_node_edge(draw_id, gol_id);\nrender_graph.add_node_edge(gol_id, bevy::render::main_graph::node::CAMERA_DRIVER);\n\nThis creates a new edge from the draw_node to the automata_node and then from the automata_node to the camera_driver! Onto the draw shader!!\nDraw Shader\ncreate a file called draw.wgsl in our shaders folder and add the following starter code:\nstruct PushConstants {\n    draw_start: vec2&lt;f32&gt;,\n    draw_end: vec2&lt;f32&gt;,\n    draw_radius: f32,\n}\nvar&lt;push_constant&gt; pc: PushConstants;\n\n@group(0) @binding(0)\nvar texture: texture_storage_2d&lt;rgba8unorm, read_write&gt;;\n\n@compute @workgroup_size(8, 8, 1)\nfn draw(@builtin(global_invocation_id) invocation_id: vec3&lt;u32&gt;)\n{\n    let pixel = vec2&lt;u32&gt;(invocation_id.xy);\n    let size = vec2&lt;u32&gt;(textureDimensions(texture));\n    if (pixel.x &gt;= size.x &amp;&amp; pixel.y &gt;= size.y) {\n        return ;\n    }\n\n    // Draw circle\n    if (pc.draw_radius &gt; 0.0) {\n\n    }\n}\n\nThis is all familiar except for the new push_contant and a new function: textureDimensions. The push_contant variable should match what we are passing from\nrust side of things. We are passing in the start and end of the mouse position as well as the radius of the circle we want to draw.\ntextureDimensions function returns the dimensions of the texture we are sampling from.We use this to check if the current pixel is outside of the texture\nbounds.\nNow we pass in a start and end position, so we need to generate a line between these two points. Searching the web I found the following stackoverflow\nthread with many examples: shortest-distance-between-a-point-and-a-line-segment\n// Line v-&gt;w, point p\n// https://stackoverflow.com/questions/849211/shortest-distance-between-a-point-and-a-line-segment\nfn closest_point_on_line(v: vec2&lt;f32&gt;, w: vec2&lt;f32&gt;, p: vec2&lt;f32&gt;) -&gt; vec2&lt;f32&gt; {\n    let c = v - w;\n\n    // length squared\n    let l2 = dot(c, c);\n    if (l2 == 0.0) {\n        return v;\n    }\n\n    let t = max(0.0, min(1.0, dot(p - v, w - v) / l2));\n    let projection = v + t * (w - v);\n    return projection;\n}\n\n\nChallenge: Feel free to scower the web for your own implementation and try replacing my implementation with yours!\n\nUsing this in our draw function:\n// Draw circle\n    if (pc.draw_radius &gt; 0.0) {\n        let pos = vec2&lt;f32&gt;(pixel);\n        let point_on_line = closest_point_on_line(pc.draw_start, pc.draw_end, pos);\n    }\n\nWe need to cast our pixel variable to an f32 to be used by our closest_point_on_line function. We can now use this point to draw with. Add a new function\nfor drawing a circle:\nfn draw_particle_circle(pos: vec2&lt;f32&gt;, draw_pos: vec2&lt;f32&gt;, radius: f32) {\n    let y_start = draw_pos.y - radius;\n    let y_end = draw_pos.y + radius;\n    let x_start = draw_pos.x - radius;\n    let x_end = draw_pos.x + radius;\n    if (pos.x &gt;= x_start &amp;&amp; pos.x &lt;= x_end &amp;&amp; pos.y &gt;= y_start &amp;&amp; pos.y &lt;= y_end) {\n        let diff = pos - draw_pos;\n        let dist = length(diff);\n        if (round(dist) &lt;= radius) {\n            textureStore(texture, vec2&lt;i32&gt;(pos), vec4&lt;f32&gt;(1.0, 1.0, 1.0, 1.0));\n        }\n    }\n}\n\nThis looks pretty similar to how you would draw a circle on the rust side. We create a bounding box based on the radius and make sure our click position\nfalls within that box. If it does, we calculate the distance from the click position to the current pixel and if that distance is less than or equal to\nthe radius, we store an alive cell at that position. (remember our alive cells are marked by a 1.0 value in the r channel of the pixel color).\nFinish off our shader:\n// Draw circle\nif (pc.draw_radius &gt; 0.0) {\n    let pos = vec2&lt;f32&gt;(pixel);\n    let point_on_line = closest_point_on_line(pc.draw_start, pc.draw_end, pos);\n    draw_particle_circle(pos, point_on_line, pc.draw_radius);\n}\n\nComplete\nRunning the example you should be able to draw on the simulation with your mouse:\n\n  \n\nBonus\nOne thing you might notice is our simulation doesnt wrap between the edges. We can fix this by maniupulating our game_of_life.wgsl slightly.\nIn the is_alive function we can add the following:\nfn is_alive(location: vec2&lt;i32&gt;, offset_x: i32, offset_y: i32) -&gt; u32 {\n    let size = vec2&lt;i32&gt;(textureDimensions(texture));\n    var loc = ((location + vec2&lt;i32&gt;(offset_x, offset_y)) + size) % size;\n    let value: vec4&lt;f32&gt; = textureLoad(texture, loc);\n    return u32(value.x);\n}\n\nI broke out the calculations onto multiple lines for readability. We first get the dimensions of the texture we are sampling from. We then add the offset\nto the current location, add the size to that result and finally mod the result by the size. This will wrap the edges of the texture both x and y.\nWith that, our cells will now wrap around the edges of the simulation! Awesome!\n\nChallenge: Create a method to draw a square instead of a circle. For even more complexity, you can add a push_constant bool to pass in\nwhether you want to draw a circle or a square.\n\nCode can be found on github: Part 4\n","id":"https://n16hth4wkk.github.io/bevy-gol-explore-part-4/","title":"Exploring Bevy Game of life shader (Part 4)"},"https://n16hth4wkk.github.io/bevy-gol-explore-part-5/":{"body":"If you have been following along, I have moved my tutorials to mdbook located on the repo itself. This was easier to develop and create\nblog post in parallel, than having to manage two repos as once.\nyou can find the rest of the tutorials here: Bevy Shader Playground\n","id":"https://n16hth4wkk.github.io/bevy-gol-explore-part-5/","title":"Exploring Bevy Game of life shader (Part 5)"},"https://n16hth4wkk.github.io/first-post/":{"body":"Welcome to Yendor's Blog! I will be posting about my experiences in programming, technical writing, game development, travel, and other things that I find interesting. I hope you enjoy reading my posts!\nI thought a good first post would be choosing user names for the internet. For me, usernames were derived from my gaming days. I had various Gamertags throughout my years of gaming, from CupCakeMan to Posideon, and my final Gamertag was BigFatBanana. BigFatBanana was a joke among my friends, mostly in lewd references, but since those younger days, I still find myself enjoying BigBanana.\nUsernames always seem to convey a smaller piece of our personality. Some choose to have meme usernames that play more into their comedic side, while others choose to have more serious usernames. The main challenge is choosing a username that sticks forever, which is my current dilemma.\nFor now, I am sticking with Yendor, from my love of rougelike games.\n","id":"https://n16hth4wkk.github.io/first-post/","title":"First Blog Post"},"https://n16hth4wkk.github.io/pages/":{"body":"","id":"https://n16hth4wkk.github.io/pages/","title":""}},"docInfo":{"https://n16hth4wkk.github.io/":{"body":0,"title":0},"https://n16hth4wkk.github.io/about/":{"body":16,"title":0},"https://n16hth4wkk.github.io/archive/":{"body":0,"title":1},"https://n16hth4wkk.github.io/bevy-gol-explore-part-1/":{"body":789,"title":7},"https://n16hth4wkk.github.io/bevy-gol-explore-part-2/":{"body":1021,"title":7},"https://n16hth4wkk.github.io/bevy-gol-explore-part-3/":{"body":476,"title":7},"https://n16hth4wkk.github.io/bevy-gol-explore-part-4/":{"body":1488,"title":7},"https://n16hth4wkk.github.io/bevy-gol-explore-part-5/":{"body":26,"title":7},"https://n16hth4wkk.github.io/first-post/":{"body":87,"title":3},"https://n16hth4wkk.github.io/pages/":{"body":0,"title":0}},"length":10},"lang":"English"};